BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS entries (
    id SERIAL PRIMARY KEY,
    list_index INTEGER,
    kanji TEXT,
    kana TEXT,
    meaning TEXT
);

-- Table: questions
CREATE TABLE IF NOT EXISTS questions (
    id SERIAL PRIMARY KEY,
    entry_id INTEGER REFERENCES entries(id),
    q_type TEXT,
    prompt TEXT,
    correct_answer TEXT,
    options TEXT,
    correct_index INTEGER,
    created_at TIMESTAMP
);

CREATE INDEX IF NOT EXISTS "idx_entry_id" ON "questions" (
	"entry_id"
);
CREATE INDEX IF NOT EXISTS "idx_q_type" ON "questions" (
	"q_type"
);
COMMIT;